(58, 'wcpay-promo-2020-12', 'marketing', 'en_US', 'wcpay-promo-2020-12', 'wcpay-promo-2020-12', '{}', 'pending', 'woocommerce.com', '2021-07-25 11:53:15', NULL, 0, 'plain', '', 0, 'info', 1),
(59, 'wcpay-promo-2021-6-incentive-1', 'marketing', 'en_US', 'Simplify the payments process for you and your customers with WooCommerce Payments', 'With <a href=\"https://woocommerce.com/payments/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">WooCommerce Payments</a>, you can securely accept all major cards, Apple Pay®, and recurring revenue in over 100 currencies. \n				Built into your store’s WooCommerce dashboard, track cash flow and manage all of your transactions in one place – with no setup costs or monthly fees.\n				<br /><br />\n				By clicking \"Get WooCommerce Payments,\" you agree to the <a href=\"https://wordpress.com/tos/?utm_medium=notification&amp;utm_source=product&amp;utm_campaign=wcpay601\">Terms of Service</a> \n				and acknowledge you have read the <a href=\"https://automattic.com/privacy/\">Privacy Policy</a>.\n				', '{}', 'unactioned', 'woocommerce.com', '2021-07-25 11:53:15', NULL, 0, 'plain', '', 0, 'info', 1),
(60, 'cocart-wc-admin-do-with-products', 'marketing', 'en_US', '6 things you can do with CoCart Products', 'Fetching your products via the REST API should be easy with no authentication issues. Learn more about the six things you can do with CoCart Products to help your development with CoCart.', '{}', 'unactioned', 'cocart', '2021-07-25 11:53:16', NULL, 0, 'thumbnail', 'https://cocart.xyz/wp-content/uploads/2020/03/rwmibqmoxry-128x214.jpg', 0, 'info', 1),
(61, 'wc-admin-adding-and-managing-products', 'info', 'en_US', 'Adding and Managing Products', 'Learn more about how to set up products in WooCommerce through our useful documentation about adding and managing products.', '{}', 'unactioned', 'woocommerce-admin', '2021-08-26 09:49:10', NULL, 0, 'plain', '', 0, 'info', 1),
(62, 'wc-admin-real-time-order-alerts', 'info', 'en_US', 'Get real-time order alerts anywhere', 'Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.', '{}', 'unactioned', 'woocommerce-admin', '2021-09-23 04:27:28', NULL, 0, 'plain', '', 0, 'info', 1),
(63, 'wc-admin-manage-orders-on-the-go', 'info', 'en_US', 'Manage your orders on the go', 'Look for orders, customer info, and process refunds in one click with the Woo app.', '{}', 'unactioned', 'woocommerce-admin', '2021-12-25 06:20:47', NULL, 0, 'plain', '', 0, 'info', 1),
(64, 'wc-update-db-reminder', 'update', 'en_US', 'WooCommerce database update done', 'WooCommerce database update complete. Thank you for updating to the latest version!', '{}', 'actioned', 'woocommerce-core', '2021-12-25 06:25:17', NULL, 0, 'plain', '', 0, 'info', 1),
(65, 'surface_cart_checkout', 'info', 'en_US', 'Introducing the Cart and Checkout blocks!', 'Increase your store\'s revenue with the conversion optimized Cart &amp; Checkout WooCommerce blocks available in the WooCommerce Blocks extension.', '{}', 'unactioned', 'woo-gutenberg-products-block', '2021-12-25 06:37:57', NULL, 0, 'plain', '', 0, 'info', 1),
(66, 'wc-refund-returns-page', 'info', 'en_US', 'Setup a Refund and Returns Policy page to boost your store\'s credibility.', 'We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.', '{}', 'unactioned', 'woocommerce-core', '2021-12-25 06:45:43', NULL, 0, 'plain', '', 0, 'info', 1),
(67, 'wc-admin-complete-store-details', 'info', 'en_US', 'Add your store details to complete store setup', 'Complete your store details with important information for setup such as your store’s base address', '{}', 'unactioned', 'woocommerce-admin', '2021-12-25 09:48:14', NULL, 0, 'plain', '', 0, 'info', 1),
(68, 'wc-admin-navigation-nudge', 'info', 'en_US', 'You now have access to the WooCommerce navigation', 'We’re introducing a new navigation for a more intuitive and improved user experience. You can enable the beta version of the new experience in the Advanced Settings. Enable it now for your store.', '{}', 'unactioned', 'woocommerce-admin', '2021-12-29 17:30:52', NULL, 0, 'plain', '', 0, 'info', 0);
